async function getBalance(address){
        try {
          const resBalanceData = await fetch(`/getAddressBalance/${address}`);
          const resBalance = await resBalanceData.json();
          const content = [{
            status: "success",
            balance: resBalance.balance/1e18,
          }]
          return content;
        } catch (err) {
          return [{status:"error"},err]
        }
    //   });
}

