async function connectWallet(k){
    if(localStorage.getItem("address") == undefined){
    switch(k){
        case 'metamask':
      // Start loader while connecting
      $(".connectWallet article .metamask div #loading").css("display", "flex")

      if (typeof window.ethereum !== "undefined") {
        if(window.ethereum.chainId != chainId){
            await ethereum.request({
                method: 'wallet_addEthereumChain',
                params: [{
                chainId: chainId,
                chainName: nName,
                nativeCurrency: {
                    name: 'Polygon',
                    symbol: cCymbol,
                    decimals: 18
                },
                rpcUrls: [rpcUrl],
                blockExplorerUrls: [explorer]
                }]
                })
                .then((b) => {
                    console.log(b)
                    connectWallet(k)
                })
                .catch((error) => {
                    console.log(error, error.code);
  
                    // Stop loader if error occured
                    // For example, when user cancelled request 
                    // and closed plugin
                    switch(error.code){
                     case 4001:
                         Swal.fire(
                             "Connection Rejected",
                             error.code + ":The request was rejected by the user",
                             "error"
                         ).then(()=>{
                             document.location.reload(true)
                         })
                     break;
                     case -32602:
                         Swal.fire(
                             "Invalid parameters",
                             error.code + ":"+error.message,
                             "error"
                         ).then(()=>{
                             document.location.reload(true)
                         })
                     break;
                     case -32603:
                         Swal.fire(
                             "Internal Error",
                             error.code + ":"+error.message,
                             "error"
                         ).then(()=>{
                             document.location.reload(true)
                         })
                     break;
                     case -32002:
                         console.log("Waiting..")
                     break;
                     default:
                         Swal.fire(
                             "Error",
                             error.code + ":"+error.message,
                             "error"
                         ).then(()=>{
                             document.location.reload(true)
                         })
                    }
         
         
                    // 4001 - The request was rejected by the user
                    // -32602 - The parameters were invalid
                    // -32603- Internal error
                }) 
        }else{
            ethereum
            .request({ method: "eth_requestAccounts" })
            .then((accounts) => {
               const account = accounts[0]
  
               localStorage.setItem("address", account)
  
               // Stop loader when connected
               document.location.reload(true)
           }).catch((error) => {
             // Handle error
             console.log(error, error.code);
  
             // Stop loader if error occured
             // For example, when user cancelled request 
             // and closed plugin
             switch(error.code){
              case 4001:
                  Swal.fire(
                      "Connection Rejected",
                      error.code + ":The request was rejected by the user",
                      "error"
                  ).then(()=>{
                      document.location.reload(true)
                  })
              break;
              case -32602:
                  Swal.fire(
                      "Invalid parameters",
                      error.code + ":"+error.message,
                      "error"
                  ).then(()=>{
                      document.location.reload(true)
                  })
              break;
              case -32603:
                  Swal.fire(
                      "Internal Error",
                      error.code + ":"+error.message,
                      "error"
                  ).then(()=>{
                      document.location.reload(true)
                  })
              break;
              case -32002:
                  console.log("Waiting..")
              break;
              default:
                  Swal.fire(
                      "Error",
                      error.code + ":"+error.message,
                      "error"
                  ).then(()=>{
                      document.location.reload(true)
                  })
             }
  
  
             // 4001 - The request was rejected by the user
             // -32602 - The parameters were invalid
             // -32603- Internal error
           });   
        }
      } else { 
          // Find the function which checks if device is mobile
          // at my github repo or anywhere
         if (mobileCheck()) {
            Swal.fire(
                "Error",
                "If you are on a mobile phone, please use MetaMask application's browser to connect.",
                "error"
               ).then(()=>{
                document.location.reload(true)
               })
         } else {
           window.open("https://metamask.io/download/", "_blank");

           // Show 'Reload page' warning to user
           Swal.fire(
            "Warning",
            "Please refresh your browser after installing the Metamask plugin",
            "error"
           ).then(()=>{
            document.location.reload(true)
           })
         }
      }
        break;
    }
    }
}

