function encodeImageFileAsURL(element) {
    var file = element.files[0];
    var reader = new FileReader();
    console.log(file)
    reader.onloadend = function() {
        if(file.type.includes("image/")){
            if(file.size > 1000000){
                Toast.fire("Error", "Image too large in size.", "error")
            }else{
                var img = reader.result;
                Swal.fire({
                    html: '<p>Do you want to add this image to your NFT?</p><div class="dawimg"><img style="width: 100%; max-width:280px" src="' + img + '"></div>',
                    title: 'Send Image',
                    showConfirmButton: true,
                    showCancelButton: true,
                    confirmButtonText: 'Yes',
                    cancelButtonText: 'No'
                }).then((result) => {
                    if(result.isConfirmed){
                        $("#createNFT .content .select img").attr("src", img)
                        $("#createNFT .content .select img").attr("style", "height: 100%; width: max-content; border: none; border-radius: 0px; max-width: 100%; max-height: 100%;")
                    }
                })
            }
        }else{
            Toast.fire("Error", "Add only images.", "error")
        }
    }
    reader.readAsDataURL(file);
}

function formatIPFS(ipfs) {
    var index = (ipfs).indexOf('/ipfs/');
    var img = ipfs.substr(index,ipfs.length).replace("/ipfs/","ipfs://")
    return img

}

function formatIPFStoMoralis(ipfs) {
    if(ipfs.includes("http")){
        return ipfs
    }else{
        var index = "https://ipfs.moralis.io:2053"+(ipfs)
        var img = index.replace("ipfs://","/ipfs/")
        return img
    }
}

async function createNFT(){
    if(fieldsNft()){
        try {
            $("#aLoader").css("display", "flex")
            const abi = [
                {
                    path: `${$("#collNFT").val()}/${$("#nameNFT").val()}.${$("#createNFT .content .select img").attr("src").split(';')[0].split('/')[1]}`,
                    content: $("#createNFT .content .select img").attr("src"),
                },
            ];
            const resBalanceData = await fetch(`/uploadToIPFS/${btoa(JSON.stringify(abi))}`);
            const content = await resBalanceData.json();
            var img = (await content[0].path)
            const abia = [
                {
                    path: "metadata.json",
                    content: {
                        name: $("#nameNFT").val(),
                        description: $("#descNFT").val(),
                        image:img,
                        attributes: []
                    },
                },
            ]
            const resBalanceDataa = await fetch(`/uploadToIPFS/${btoa(JSON.stringify(abia))}`);
            const content1 = await resBalanceDataa.json();
            var uri = (await content1[0].path)
            console.log(uri)
            const encodedFunction = web33.eth.abi.encodeFunctionCall({
                name: "Mint",
                type: "function",
                inputs: [{
                    type: "string",
                    name: "tokenURI"
                }]
            }, [uri])
            const txP = {
                to: nftMintContract,
                from: localStorage.getItem("address"),
                data: encodedFunction
            }
            $("#aLoader p").text("Open your metamask and confirm the transaction to create your NFT.")
            await ethereum
            .request({
                method: "eth_sendTransaction",
                params: [txP]
            })
            .then((d) => {
                Toast.fire("Success!", "NFT Transaction sent to blockchain.", "success")
                $("#aLoader").css("display", "none")
                realodField()
            }).catch(er => {
                Toast.fire("Error", JSON.stringify(er), "error")
                realodField()
            })
        } catch (err) {
            console.log(err)
            Toast.fire("Error", JSON.stringify(err), "error")
            realodField()
        }
    }else{
        Toast.fire("Error", "Please fill in all required fields to create your NFT", "error")
    }
}

